import base64
import numpy as np
import PIL.Image as Image
with open("raw.png", "wb") as fh:
    fh.write(base64.decodebytes(b""))

with open("patch.png", "wb") as fh:
    fh.write(base64.decodebytes(b""))

raw = np.array(Image.open('raw.png'))
patch = np.array(Image.open('patch.png'))
arr = [4,12,8,16,17,0,11,2,19,5,1,13,3,10,6,14,18,15,9,7]
y_up = 49

_cutx = 300//10
_cuty = 200//2
im = np.zeros((200,300,3))
for i in range(len(arr)):
    num = arr.index(i)
    x=0
    y=0
    if i>9:
        y=-_cuty
    else:
        y=0
    if i>9:
        x=(i-10)*-_cutx
    else:
        x=i*-_cutx
    if num>9 and i<10:
        y = y-_cuty
    if i>9 and num<10:
        y = y+_cuty
    x = x+(num-i)*-_cutx

    if x>0:
        x = abs(x) % 300
    else:
        x = (abs(x) % 300)*-1
    if y>0:
        y = abs(y) % 200
    else:
        y = (abs(y) % 200)*-1
    if x>0:
        x = 300-x
    else:
        x = -x
    if y>0:
        y = 200-y
    else:
        y = -y

    h_of = i // 10
    w_of = i % 10
    im[h_of*_cuty:(h_of+1)*_cuty,w_of*_cutx:(w_of+1)*_cutx,:] = raw[y:y+_cuty,x:x+_cutx,:]

im = np.uint8(im)
patch = np.uint8(patch)

Image.fromarray(im).show()
Image.fromarray(patch).show()

min = 3*255*1600
xix = -1
for i in range(261):
    err = im[y_up:y_up + 40, i:i + 40, :] - patch
    m = np.sum(err**2)
    if m<min:
        min = m
        xix = i

print(xix)